When summer comes, the heart boils;  
The ray also came and kissed.  
Heat within my body;  
The cow screams and thirsts for water.  
Dragon flies call me to play;  
Oh wait for me, I'll be coming.  
I will walk and wander, singing songs.  
Just my barefoot and burning sand,  
My body is sweating, but I am spirited to living.
